import React from "react";
import "./App.scss";

function App() {
  return (
    <nav role="custom-dropdown">
      <ul>
        <li>
          <a href="#">Stream</a>
        </li>
        <li>
          <a href="#">Lab</a>
        </li>
        <li>
          <a href="#">Projects</a>
        </li>
        <li>
          <a href="#">About</a>
        </li>
        <li>
          <a href="#">Contact</a>
        </li>
      </ul>
    </nav>
  );
}

export default App;
